import React, { Fragment } from 'react';
import './App.css';
import { NavLink } from 'react-router-dom';
import NavBar from './NavBar';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Paques from './images/Paques.png';
import Yoshilogo from './images/Yoshilogo1.png';
import PokeReact1 from './images/Pokereact1.png';
import Appmobile from './images/Appmobile.png';



  const useStyles = makeStyles({
    card: {
      maxWidth: 345,
    },
    media: {
      height: 140,
    },
  });

  function Works() {
    const classes = useStyles();

  return (
    <Fragment>
    <NavBar/>
    <div className='Block'>
        <h1 className='Titles'>Réalisations</h1>
        <br />
        <br />
    <Card className={classes.card}>
      <CardActionArea>
        <CardMedia
          className={classes.media}
          image={Appmobile}
          title="Contemplative Reptile"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="h2">
          Plateforme mobile d'e-Learning
          </Typography>
          <Typography variant="body2" color="textSecondary" component="p">
          Réalisation en équipe d'une application mobile en Javascript/React (8 semaines) pour un client réel.
          </Typography>
        </CardContent>
      </CardActionArea>

    </Card>
    <Card className={classes.card}>
      <CardActionArea>
        <CardMedia
          className={classes.media}
          image={PokeReact1}
          title="Contemplative Reptile"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="h2">
          PokeReact
          </Typography>
          <Typography variant="body2" color="textSecondary" component="p">
          Réalisation en équipe d’un jeu vidéo multijoueur Pokémon en Javascript/React (5 semaines). 
          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
      <NavLink to='/pokeReact'><Button className='buttonColor'>En savoir +</Button></NavLink>
    </CardActions>
    </Card>   
    <Card className={classes.card}>
      <CardActionArea>
        <CardMedia
          className={classes.media}
          image={Paques}
          title="Contemplative Reptile"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="h2">
          EggsPlosives
          </Typography>
          <Typography variant="body2" color="textSecondary" component="p">
          Hackaton 24h : Réalisation en équipe d’un jeu en Javascript/React à partir d’une API sur le thème de Pâques. 
          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
      <NavLink to='/eggsPlosive'><Button className='buttonColor'>En savoir +</Button></NavLink>         
      </CardActions>
    </Card>   
    <Card className={classes.card}>
      <CardActionArea>
        <CardMedia
          className={classes.media}
          image={Yoshilogo}
          title="Contemplative Reptile"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="h2">
          Yoshi : Save the Baby !
          </Typography>
          <Typography variant="body2" color="textSecondary" component="p">
          Réalisation en équipe d’un site de vente en ligne (3 semaines). Utilisation d'Html, CSS, Bootstrap et Javascript Vanilla.
          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
      <NavLink to='/yoshi'><Button className='buttonColor'>En savoir +</Button></NavLink>
      </CardActions>
    </Card>      
    </div>
    </ Fragment >
  );
}

export default Works;
